import React from "react";
import {Link} from "react-router-dom";
import {FaSlidersH} from "react-icons/fa";

const Navigation = () =>{
    return(
        <>
            <section className="main-navigation-section">
                <div className="menu">
                    <ul>
                        <li><Link className="link-style"><i></i> <FaSlidersH /> CATEGORY</Link></li>
                        <li><Link className="link-style" to="/">HOME</Link></li>
                        <li><Link className="link-style" to="/about">ABOUT US</Link></li>
                        <li><Link className="link-style" to="/services">BOOKS</Link></li>
                        <li><Link className="link-style" to="/contact">CONTACT</Link></li>
                        <li><Link className="link-style" to="/users/add">ADD User</Link></li>
                    </ul>
                </div>
            </section>
        </>
    );
}
export default Navigation;
